import React,{useState} from 'react';
import {Text, View, Button,StyleSheet} from 'react-native';
import { TextInput } from 'react-native-gesture-handler';


const Login = ({ navigation }) =>{

    const [loginText,setloginText] = ('')


    return(
        <View style={styles.container}>
            <View style={styles.innercontainer}>
                <Text >Login</Text>
                <TextInput placeholder='Enter UserName' onChangeText={text=>setloginText(text)}/>
            </View>

            <View style={styles.innercontainer}>
                <Text>Login</Text>
                <TextInput placeholder='Enter UserName' onChangeText={text=>setloginText(text)} style={{borderBottomColor:'black',borderBottomWidth:1}}/>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container:{
        justifyContent:'center',
        alignItems:'center',
        flex:1,

    },
    innercontainer:{
        flexDirection:'row',
        justifyContent:'space-evenly',
        width:'100%',
        margin:10,
        fontSize:30,
    },
});


export default Login;
